    "contracts/token/NSDispatch.sol": {
      "content": "// SPDX-License-Identifier: MIT

pragma solidity >=0.7.6;

import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC20/SafeERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "../interfaces/IEMERouter.sol";
import "hardhat/console.sol";

contract NSDispatch is Ownable {
    using SafeMath for uint256;
    using SafeERC20 for IERC20;

    uint256 private _totalSupply;
    uint256 private lastReward;
    uint256 private lastTime;
    uint256 private rewardLastStored;
    mapping(address => uint256) private _balances;
    mapping(address => uint256) private userRewardStored;
    mapping(address => uint256) private newReward;

    // The address of the smart chef factory
    address public SMART_CHEF_FACTORY;
    // Whether it is initialized
    bool public isInitialized;
    IERC20 public dispatchToken;
    IERC20 public uniV2Pair;
    IEMERouter public emeSwapV2Router;
    address private USDT;

    mapping(address => address) public referrers;
    mapping(address => uint256) public rewardPair;
    mapping(address => uint256) public rewardReferral;
    mapping(address => address[]) private funs;

    event Dispatch(uint256 amount);
    event Staked(address indexed user, uint256 amount);
    event Withdrawn(address indexed user, uint256 amount);
    event RewardPaid(address indexed user, uint256 reward);

    constructor() {
        SMART_CHEF_FACTORY = msg.sender;
    }

    function initialize(
        IEMERouter emeSwapV2Router_,
        address uniV2Pair_,
        address dispatchToken_,
        address USDT_,
        address owner_
    ) external {
        require(!isInitialized, "Already initialized");
        require(msg.sender == SMART_CHEF_FACTORY, "Not factory");
        // Make this contract initialized
        isInitialized = true;
        dispatchToken = IERC20(dispatchToken_);
        emeSwapV2Router = emeSwapV2Router_;
        uniV2Pair = IERC20(uniV2Pair_);
        USDT = USDT_;

        referrers[owner_] = address(this);

        transferOwnership(owner_);
    }

    function setReferrer(address _referrer) external {
        require(referrers[msg.sender] == address(0), "Repeat binding");
        require(
            referrers[_referrer] != address(0),
            "Referrer does not have permission"
        );
        referrers[msg.sender] = _referrer;
        funs[_referrer].push(msg.sender);
    }

    modifier updateDispatch(address account) {
        rewardLastStored = rewardPer();
        lastReward = 0;
        if (account != address(0)) {
            newReward[account] = available(account);
            userRewardStored[account] = rewardLastStored;
        }
        _;
    }

    function totalSupply() public view returns (uint256) {
        return _totalSupply;
    }

    function balanceOf(address account) public view returns (uint256) {
        return _balances[account];
    }

    function rewardPer() private view returns (uint256) {
        if (totalSupply() == 0) {
            return rewardLastStored;
        }
        return rewardLastStored.add(lastReward.mul(1e18).div(totalSupply()));
    }

    function stake(uint256 amount) external updateDispatch(msg.sender) {
        _totalSupply = _totalSupply.add(amount);
        _balances[msg.sender] = _balances[msg.sender].add(amount);
        uniV2Pair.safeTransferFrom(msg.sender, address(this), amount);

        emit Staked(msg.sender, amount);
    }

    function withdraw(uint256 amount) external updateDispatch(msg.sender) {
        _totalSupply = _totalSupply.sub(amount);
        _balances[msg.sender] = _balances[msg.sender].sub(amount);
        uniV2Pair.safeTransfer(msg.sender, amount);
        emit Withdrawn(msg.sender, amount);
    }

    function available(address account) public view returns (uint256) {
        return
            balanceOf(account)
                .mul(rewardPer().sub(userRewardStored[account]))
                .div(1e18)
                .add(newReward[account]);
    }

    function claim() external updateDispatch(msg.sender) {
        uint256 reward = available(msg.sender);
        if (reward <= 0) {
            return;
        }
        newReward[msg.sender] = 0;

        uint256[] memory amounts = _swapExactTokensForTokens(reward);
        uint256 _reward = amounts[1];
        rewardPair[msg.sender] = rewardPair[msg.sender].add(
            _reward.mul(90).div(100)
        );
        IERC20(USDT).safeTransfer(msg.sender, _reward.mul(90).div(100));
        address _ref = referrers[msg.sender];
        if (_ref != address(0)) {
            rewardReferral[_ref] = rewardReferral[_ref].add(
                _reward.mul(10).div(100)
            );
            IERC20(USDT).safeTransfer(_ref, _reward.mul(10).div(100));
        }

        emit RewardPaid(msg.sender, _reward);
    }

    function dispatch(uint256 _value) external updateDispatch(address(0)) {
        lastReward = _value;

        dispatchToken.safeTransferFrom(msg.sender, address(this), _value);

        uint256 uBalance = IERC20(USDT).balanceOf(address(this));
        if (uBalance > 0) {
            IERC20(USDT).safeTransfer(owner(), uBalance);
        }
    }

    function _swapExactTokensForTokens(uint256 tokenAmount)
        private
        returns (uint256[] memory amounts)
    {
        address[] memory path = new address[](2);
        path[0] = address(dispatchToken);
        path[1] = USDT;

        dispatchToken.approve(address(emeSwapV2Router), tokenAmount);

        amounts = emeSwapV2Router.swapExactTokensForTokens(
            tokenAmount,
            0,
            path,
            address(this),
            block.timestamp
        );

        emit Dispatch(tokenAmount);
    }

    function getFuns(address account) public view returns (address[] memory) {
        return funs[account];
    }
}
"
    },
    "contracts/token/NSToken.sol": {
      "content": "// SPDX-License-Identifier: MIT

pragma solidity >=0.7.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/utils/Address.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "../interfaces/IEMERouter.sol";
import "../interfaces/IEMEFactory.sol";
import "./SwapRouter.sol";
import "./NSDispatch.sol";
import "hardhat/console.sol";

contract NSToken is IERC20, Ownable {
    using SafeMath for uint256;
    using Address for address;

    string public name;
    string public symbol;
    uint8 public decimals;

    uint256 public override totalSupply;
    uint256 public remainedSupply;

    mapping(uint256 => uint256) public totalVolume;
    mapping(address => mapping(uint256 => bool)) public isSuperierHarvest;
    mapping(address => mapping(uint256 => bool)) public isHarvest;

    struct UserInfo {
        address superier;
        mapping(uint256 => uint256) volume;
        mapping(uint256 => uint256) daoVolume;
    }
    uint256 private volumeMinIndex;
    mapping(uint256 => address[]) private volumeRank;
    mapping(address => UserInfo) private userInfos;

    address public constant hole = 0x000000000000000000000000000000000000dEaD;

    mapping(address => uint256) public override balanceOf;
    mapping(address => mapping(address => uint256)) public override allowance;

    mapping(address => bool) public _isExcludedFrom;

    SwapRouter public _router;
    bool private inSwapAndLiquify;
    bool public swapAndLiquifyEnabled = true;

    address public swapV2Pair;
    NSDispatch public dispatch;

    constructor(IEMERouter _swapRouter, address _usdt) {
        name = "N.S.Guild";
        symbol = "NS";
        decimals = 18;
        remainedSupply = 20000000 * (10**18);
        _isExcludedFrom[msg.sender] = true;
        _isExcludedFrom[address(this)] = true;

        _mint(msg.sender, 7000000 * (10**18));
        swapV2Pair = IEMEFactory(_swapRouter.factory()).createPair(
            address(this),
            _usdt
        );

        bytes memory bytecode = type(NSDispatch).creationCode;
        bytes32 salt = keccak256(
            abi.encodePacked(block.timestamp, address(this))
        );
        address smartDispatch;
        assembly {
            smartDispatch := create2(
                0,
                add(bytecode, 32),
                mload(bytecode),
                salt
            )
        }
        dispatch = NSDispatch(smartDispatch);
        dispatch.initialize(
            _swapRouter,
            swapV2Pair,
            address(this),
            _usdt,
            msg.sender
        );
        allowance[address(this)][smartDispatch] = uint256(-1);
        emit Approval(address(this), smartDispatch, uint256(-1));
        _isExcludedFrom[smartDispatch] = true;
    }

    function getUserInfo(address account, uint256 dayNumber)
        public
        view
        returns (
            address superier,
            uint256 volume,
            uint256 daoVolume
        )
    {
        return (
            userInfos[account].superier,
            userInfos[account].volume[dayNumber],
            userInfos[account].daoVolume[dayNumber]
        );
    }

    function getRank() public view returns (address[] memory) {
        return volumeRank[today()];
    }

    modifier lockTheSwap() {
        inSwapAndLiquify = true;
        _;
        inSwapAndLiquify = false;
    }

    function currentDay() public view returns (uint256) {
        return block.timestamp.div(1 days);
    }

    function updateRouter(address _rou) public onlyOwner {
        _router = SwapRouter(_rou);
        allowance[address(this)][address(_router)] = uint256(-1);
        emit Approval(address(this), address(_router), uint256(-1));
    }

    function setSwapAndLiquifyEnabled(bool _switch) external onlyOwner {
        swapAndLiquifyEnabled = _switch;
    }

    function setDispatch(NSDispatch _dispatch) external onlyOwner {
        dispatch = _dispatch;
        allowance[address(this)][address(_dispatch)] = uint256(-1);
        emit Approval(address(this), address(_dispatch), uint256(-1));
        _isExcludedFrom[address(_dispatch)] = true;
    }

    function excludeFrom(address account) external onlyOwner {
        _isExcludedFrom[account] = true;
    }

    function includeInFrom(address account) external onlyOwner {
        _isExcludedFrom[account] = false;
    }

    function _mint(address to, uint256 amount) internal {
        require(to != address(0), "zero address");
        require(remainedSupply >= amount, "mint too much");

        remainedSupply -= amount;
        totalSupply += amount;
        balanceOf[to] += amount;

        emit Transfer(address(0), to, amount);
    }

    function _transfer(
        address from,
        address to,
        uint256 amount
    ) private {
        require(to != address(0), "zero address");
        require(balanceOf[from] >= amount, "balance not enough");

        balanceOf[from] -= amount;

        if (
            _isExcludedFrom[to] ||
            _isExcludedFrom[from] ||
            (from != swapV2Pair && to != swapV2Pair)
        ) {
            setSuperier(from, to);
            balanceOf[to] += amount;
            emit Transfer(from, to, amount);
        } else {
            if (from == swapV2Pair) {
                updateVolume(to, amount);

                balanceOf[to] += amount.mul(96).div(100);
                emit Transfer(from, to, amount.mul(96).div(100));

                balanceOf[address(this)] += amount.mul(4).div(100);
                emit Transfer(from, address(this), amount.mul(4).div(100));
                nsDispatch(amount.mul(2).div(100));
            } else {
                updateVolume(from, amount);
                balanceOf[address(this)] += amount.mul(3).div(100);
                emit Transfer(from, address(this), amount.mul(3).div(100));

                balanceOf[hole] += amount.mul(2).div(100);
                emit Transfer(from, hole, amount.mul(2).div(100));
                balanceOf[to] += amount.mul(95).div(100);
                emit Transfer(from, to, amount.mul(95).div(100));
            }
        }

        if (from != swapV2Pair && to != swapV2Pair && !inSwapAndLiquify) {
            swapAndLiquify();
        }
    }

    function nsDispatch(uint256 value) private lockTheSwap {
        dispatch.dispatch(value);
    }

    function swapAndLiquify() public lockTheSwap {
        if (swapAndLiquifyEnabled) {
            uint256 balance = balanceOf[address(this)];
            if (balance > 1 * 10**decimals) {
                _router.swapAndLiquifyToken(balance);
            }
        }
    }

    function setSuperier(address _account, address _superier) internal {
        UserInfo storage userInfo = userInfos[_account];
        if (
            !_superier.isContract() &&
            !_account.isContract() &&
            userInfo.superier == address(0)
        ) {
            userInfo.superier = _superier;
        }
    }

    function updateVolume(address _account, uint256 amount) internal {
        UserInfo storage userInfo = userInfos[_account];
        if (userInfo.superier != address(0)) {
            userInfo.volume[today()] += amount;
            totalVolume[today()] = totalVolume[today()].add(amount);

            UserInfo storage superierInfo = userInfos[userInfo.superier];
            superierInfo.daoVolume[today()] += amount;

            bool isBreak;
            for (uint256 i = 0; i != volumeRank[today()].length; i++) {
                if (volumeRank[today()][i] == userInfo.superier) {
                    isBreak = true;
                    break;
                }
            }
            if (isBreak) {
                return;
            }
            if (volumeRank[today()].length < 20) {
                volumeRank[today()].push(userInfo.superier);
            } else {
                uint256 minIdx = findMinIndex();
                uint256 minVolume = userInfos[volumeRank[today()][minIdx]]
                    .daoVolume[today()];
                if (superierInfo.daoVolume[today()] > minVolume) {
                    volumeRank[today()][minIdx] = userInfo.superier;
                }
            }
        }
    }

    function findMinIndex() internal view returns (uint256) {
        uint256 minIdx;
        for (uint256 i = 0; i != volumeRank[today()].length; i++) {
            uint256 minVolume = userInfos[volumeRank[today()][minIdx]]
                .daoVolume[today()];
            uint256 currVolume = userInfos[volumeRank[today()][i]].daoVolume[
                today()
            ];
            if (currVolume < minVolume) {
                minIdx = i;
            }
        }
        return minIdx;
    }

    function rewardSuperier(address account) public view returns (uint256) {
        if (totalVolume[today() - 1] == 0) {
            return 0;
        }
        if (isSuperierHarvest[account][today() - 1]) {
            return 0;
        }
        UserInfo storage userInfo = userInfos[account];
        uint256 daoVolume = userInfo.daoVolume[today() - 1];
        if (daoVolume == 0) {
            return 0;
        }
        uint256 rank = 1;
        for (uint256 i = 0; i != volumeRank[today() - 1].length; i++) {
            if (
                userInfos[volumeRank[today() - 1][i]].daoVolume[today() - 1] >
                daoVolume
            ) {
                rank++;
            }
        }

        uint256 rewardTotal = totalVolume[today() - 1].div(100);
        if (remainedSupply < rewardTotal) {
            return 0;
        }

        if (rank == 1) {
            rewardTotal = rewardTotal.mul(30).div(100);
        } else if (rank == 2) {
            rewardTotal = rewardTotal.mul(20).div(100);
        } else if (rank == 3) {
            rewardTotal = rewardTotal.mul(10).div(100);
        } else if (rank > 3 && rank <= 6) {
            rewardTotal = rewardTotal.mul(6).div(100);
        } else if (rank > 6 && rank <= 10) {
            rewardTotal = rewardTotal.mul(55).div(1000);
        } else {
            return 0;
        }

        return rewardTotal.mul(10).div(100);
    }

    function reward(address account) public view returns (uint256) {
        if (totalVolume[today() - 1] == 0) {
            return 0;
        }
        if (isHarvest[account][today() - 1]) {
            return 0;
        }
        UserInfo storage userInfo = userInfos[account];
        uint256 daoVolume = userInfos[userInfo.superier].daoVolume[today() - 1];
        if (daoVolume == 0) {
            return 0;
        }
        uint256 rank = 1;
        for (uint256 i = 0; i != volumeRank[today() - 1].length; i++) {
            if (
                userInfos[volumeRank[today() - 1][i]].daoVolume[today() - 1] >
                daoVolume
            ) {
                rank++;
            }
        }

        uint256 rewardTotal = totalVolume[today() - 1].div(100);
        if (remainedSupply < rewardTotal) {
            return 0;
        }
        if (rank == 1) {
            rewardTotal = rewardTotal.mul(30).div(100);
        } else if (rank == 2) {
            rewardTotal = rewardTotal.mul(20).div(100);
        } else if (rank == 3) {
            rewardTotal = rewardTotal.mul(10).div(100);
        } else if (rank > 3 && rank <= 6) {
            rewardTotal = rewardTotal.mul(6).div(100);
        } else if (rank > 6 && rank <= 10) {
            rewardTotal = rewardTotal.mul(55).div(1000);
        } else {
            return 0;
        }

        uint256 prop = userInfo.volume[today() - 1].mul(10**18).div(daoVolume);

        return rewardTotal.mul(90).div(100).mul(prop).div(10**18);
    }

    function claim() external {
        uint256 _reward = reward(msg.sender);
        require(_reward > 0, "no rewards to claim");
        isHarvest[msg.sender][today() - 1] = true;

        _mint(msg.sender, _reward);
    }

    function superierClaim() external {
        uint256 _reward = rewardSuperier(msg.sender);
        require(_reward > 0, "no rewards to claim");
        isSuperierHarvest[msg.sender][today() - 1] = true;

        _mint(msg.sender, _reward);
    }

    function today() public view returns (uint256) {
        return currentDay();
    }

    function _approve(
        address owner,
        address spender,
        uint256 amount
    ) private {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");

        allowance[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    function transfer(address to, uint256 amount)
        external
        override
        returns (bool)
    {
        _transfer(msg.sender, to, amount);
        return true;
    }

    function transferFrom(
        address from,
        address to,
        uint256 amount
    ) external override returns (bool) {
        require(allowance[from][msg.sender] >= amount, "allowance not enough");

        allowance[from][msg.sender] -= amount;
        _transfer(from, to, amount);

        return true;
    }

    function approve(address spender, uint256 amount)
        external
        override
        returns (bool)
    {
        _approve(_msgSender(), spender, amount);

        return true;
    }
}
"
